(199, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:76:\"Crafting the Ideal B2B WordPress Website With Elementor: Hive’s Case Study\";s:7:\"excerpt\";s:244:\"Hive is the world\'s first democratic project management platform. Read about how Elementor has become an essential tool in its marketing arsenal, enabling the B2B platform to take on more projects, drive more leads, and scale even more rapidly.\";s:7:\"created\";i:1648561497;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:115:\"https://elementor.com/blog/hive-case-study/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:81:\"How To Use Illustration in Web Design & 20+ Great Examples of Illustration Styles\";s:7:\"excerpt\";s:205:\"Illustrations can be a very effective way of conveying the tone and style of your brand and website. Find out why and when to use illustrations, and explore the different illustration styles you can use. \";s:7:\"created\";i:1648464662;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:130:\"https://elementor.com/blog/web-design-illustration-styles/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:49:\"How Web Creators Can Start Live Streaming in 2022\";s:7:\"excerpt\";s:281:\"Web creators can gain great benefits from live streaming — displaying their work, generating engagement, and networking with other creators. Discover how to start live streaming on the web, from collecting the basic streaming gear to choosing the best platform for your audience.\";s:7:\"created\";i:1648003040;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:149:\"https://elementor.com/blog/how-web-creators-can-start-live-streaming-in-2022/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:35:\"Elementor Websites of February 2022\";s:7:\"excerpt\";s:263:\"February’s showcase adds some much-needed color and excitement to the long wintery season. From high-end business technology and creative NFTs to underground urban paintings and community arts and so much in between, these websites offer something for everyone.\";s:7:\"created\";i:1647516309;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/showcase-february-2022/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:54:\"6 Top Ecommerce Security Threats and Solutions of 2022\";s:7:\"excerpt\";s:267:\"According to recent studies, 32% of direct and organic traffic to ecommerce sites comes from Invalid Traffic — bots, malicious users, or suspicious users. In this article, we will dive deeper into some of these threats and offer the best solutions to address them.\";s:7:\"created\";i:1647217020;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:144:\"https://elementor.com/blog/top-ecommerce-security-threats-and-solutions/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
